import React from 'react';

const Card = () => {
  return (
    <div>
      <img src='https://robohash.org/test?size=200x200' alt='robots' />
      <div>
        <h2>Hannah</h2>
        <p>hannah@test.com</p>
      </div>
    </div>
  );
};

export default Card;
